import React from 'react';
import { Link } from 'react-router-dom'; // Import Link for routing
import img from './Image/m1.jpeg'; // Adjust the path to your image
import img1 from './Image/vid2.jpeg'; 
function Card() {
  return (
    <div className='card-container'>
      <div className="card">
        <img src={img} className="card-img-top" alt="Machine" />
        <img src={img} className="card-img-top" alt="Machine" />
        <div className="card-body">
          <h5 className="card-title">A Machine</h5>
          <p className="card-text">This is a brief description of the machine.</p>
          <Link to="/page" className="btn btn-primary">Go to Page</Link>
        </div>
      </div>
    </div>
  );
}

export default Card;
